  providedIn: 'root'
})
export class AdminService {
  saveProject(title: string, description: string) {
    const projectFormData: Project = { title, description };
    console.log(projectFormData);
    this.http
      .post&lt;Project&gt;(
        'http://localhost:3000/api/v1/projects/add',
