Mongo unique compound text index<p>I'm trying to create a Mongo index with 2 text fields, whereby either field can have a value in another document, but the same pair cannot. I am familiar with <a href="https://stackoverflow.com/questions/635937/how-do-i-specify-unique-constraint-for-multiple-columns-in-mysql">this concept in MySQL</a>, but do not understand it in Mongo.</p>

<p>I would like to create a unique index on the <code>symbol</code> and <code>date</code> fields of these documents:</p>

<pre><code>db.earnings_quotes.insert({"symbol":"UNF","date":"2017-01-04","quote":{"price": 5000}});

db.earnings_quotes.createIndex({symbol: 'text', date: 'text'}, {unique: true})

db.earnings_quotes.insert({symbol: 'HAL', date: '2018-01-22', quote: { "price": 10000 }});
WriteResult({
        "nInserted" : 0,
        "writeError" : {
                "code" : 11000,
                "errmsg" : "insertDocument :: caused by :: 11000 E11000 duplicate key error index: sample.earnings_quotes.$symbol_text_date_text  dup key: { : \"01\", : 0.6666666666666666 }"
        }
})
</code></pre>

<p>I don't understand the error message here... In this case, neither <code>symbol</code>, nor <code>date</code> overlap with the first record.</p>

