How to filter a sub array but keep the root content?<p>Using mongo 3.6</p>

<p>I have a top level object that has attributes that contain array of content. </p>

<pre><code>
      {
        firstName: "first1",
        lastName: "last1",
        phones: [
          {
            name: "home",
            number: "1800"
          },
          {
            name: "work",
            number: "1888"
          }
        ]
      }
</code></pre>

<p>and I want to only return 'work' phone numbers, but maintain the root content. </p>

<p>expected result would be :</p>

<pre><code> {
        firstName: "first1",
        lastName: "last1",
        phones: [
          {
            name: "work",
            number: "1888"
          }
        ]
      }
</code></pre>

<p>The use case is return patients that are on specific medications, but only return those medications and not the complete medication lists.</p>

<p>so I tried this:</p>

<pre><code> {
    $project: {
      phones: {
        $filter: {
          input: "$phones",
          as: "phones",
          cond: {
            $eq: [
              "$$phones.name",
              "work"
            ]
          }
        }
      }
    }
  }

</code></pre>

<p>I have to do this often to remove elements of sub arrays so any help would be appreciated.</p>

